  game_concept_invisible_hand_centralization:0 "Centralization"
  game_concept_invisible_hand_centralization_desc:0 "$game_concept_invisible_hand_centralization$ measures the degree to which a [realm|e]'s power and state apparatus are Centralized. Centralized Realms are easier to control and accrue many other benefits to their [ruler|e], but this comes at a cost in terms of Gold and [vassal|e] [opinion|e]."
  game_concept_invisible_hand_crown_laws:0 "Crown Laws"
  game_concept_invisible_hand_crown_laws_desc:0 "$game_concept_invisible_hand_crown_laws$ are a type of [law|e] set at the [primary_title|e] level. Such laws are set for that Title alone, and usually deal with a [liege|e]'s authority over [direct_vassals|e] for that Title."
  game_concept_invisible_hand_realm_laws:0 "Realm Laws"
  game_concept_invisible_hand_realm_laws_desc:0 "$game_concept_invisible_hand_realm_laws$ are a type of [law|e] set at the [realm|e] level. Such laws are set at the [top_liege|e] level for the entire Realm, and usually deal with a Realm's subjects rights in some form or another."
  game_concept_invisible_hand_authority_score:0 "Authority Score"
  game_concept_invisible_hand_authority_score_desc:0 "$game_concept_invisible_hand_authority_score$ defines the level of Authority a [ruler|e] enjoys over [vassals|e]. [crown_authority|e] or [tribal_authority|e] levels are set dynamically according to such score, in the following way:\n$EFFECT_LIST_BULLET$ #v 1-25#!: Nominal Authority\n$EFFECT_LIST_BULLET$ #v 26-50#!: Limited Authority\n$EFFECT_LIST_BULLET$ #v 51-75#!: High Authority\n$EFFECT_LIST_BULLET$ #v 76-100#!: Absolute Authority."
