  LAW_SET_AT_TOP_REALM_LEVEL:1 "This law can only be changed by the #e [realm|e]'s [top_liege|e]#!"
  invisible_hand_unfree_tenure_protection_laws:0 "#e [invisible_hand_tenure_unfree|E] Rights#!"
  invisible_hand_unfree_tenure_protection_laws_singular:0 "#e [invisible_hand_tenure_unfree|E] Rights#!"
  invisible_hand_unfree_tenure_protection_0:1 "Tenancy At Will"
  invisible_hand_unfree_tenure_protection_0_subname:0 "No Protection"
  invisible_hand_unfree_tenure_protection_0_effects:2 "Tenants have no security of tenure, which can be revoked at will by the landlord."
  invisible_hand_unfree_tenure_protection_1:1 "Copyhold for Lives"
  invisible_hand_unfree_tenure_protection_1_subname:0 "Moderate Protection"
  invisible_hand_unfree_tenure_protection_1_effects:2 "\nIn a copyhold, a tenant receives a copy of the tenure agreement, which is also registered in the local courts.\n\nA copyhold for lives is a type of copyhold involving three persons (other than the landlord) in a tenancy agreement. The first 'life', the land owner, holds tenancy until their death. The other two 'lives' are said to be 'in reversion and remainder' and effectively form a queue. When the first life dies, the second inherits the property and nominates a new third."
  invisible_hand_unfree_tenure_protection_2:1 "Copyhold of Inheritance"
  invisible_hand_unfree_tenure_protection_2_subname:0 "Full Protection"
  invisible_hand_unfree_tenure_protection_2_effects:2 "\nIn a copyhold, a tenant receives a copy of the tenure agreement, which is also registered in the local courts.\n\nA a copyhold of inheritance is a type of copyhold where one main tenant landholder is present. When the tenant dies, the tenancy passes on to their rightful heir."
  invisible_hand_quit_rent_laws:0 "#e [invisible_hand_quit_rent|E] Rights#!"
  invisible_hand_quit_rent_laws_singular:0 "#e [invisible_hand_quit_rent|E] Rights#!"
  invisible_hand_quit_rent_0:1 "Disallowed"
  invisible_hand_quit_rent_0_subname:0 "No Quit Rent"
  invisible_hand_quit_rent_0_effects:2 "There is no possibility for tenants to pay a quit rent to free themselves from Feudal obligations in the Realm."
  invisible_hand_quit_rent_1:1 "Tax-Like"
  invisible_hand_quit_rent_1_subname:0 "No Ceiling Quit Rent"
  invisible_hand_quit_rent_1_effects:2 "\nTenants are able to pay a quit rent to avoid Feudal obligations. The entity of the rent has no ceiling, and it is thus generally higher than a rent-like quit rent."
  invisible_hand_quit_rent_2:1 "Rent-Like"
  invisible_hand_quit_rent_2_subname:0 "Fixed Ceiling Quit Rent"
  invisible_hand_quit_rent_2_effects:2 "\nTenants are able to pay a quit rent to avoid Feudal obligations. The entity of the rent has a fixed ceiling, and it is thus generally lower than a tax-like quit rent."
  game_concept_invisible_hand_alienation:0 "Alienation"
  game_concept_invisible_hand_alienation_desc:0 "$game_concept_invisible_hand_alienation$ is the voluntary act of an owner of some [Concept( 'invisible_hand_tenure', 'Tenure' )|E] to dispose of the property (or part of a property) in favor of another. According to different $invisible_hand_alienation_rights_laws$, the [feudal|e] duties attached to the Tenure are either transferred to or owed by the new tenant."
  game_concept_invisible_hand_quit_rent:0 "Quit Rent"
  game_concept_invisible_hand_quit_rent_desc:0 "In a [invisible_hand_tenure_free|e], a $game_concept_invisible_hand_quit_rent$ is a payment that frees the tenant from Feudal obligations and services towards their landlord."
  UNFREE_TENURE_PROTECTION_IS_ON_COOLDOWN:1 "You recently changed Unfree Tenure Rights. They can be modified again after [GetCurrentDateWithDiff( GetVarTimeRemaining( CHARACTER.MakeScope, 'unfree_tenure_protection_cooldown') )]"
  TAX_LEVEL_SELECTED:1 "This is the current Tax Obligations level"
  LEVY_LEVEL_SELECTED:1 "This is the current Levy Obligations level"
  TAX_OBLIGATIONS_ON_COOLDOWN:1 "You recently changed Tax Obligations in this Province. They can be modified again after [GetCurrentDateWithDiff( GetVarTimeRemaining( PROVINCE.MakeScope, 'tax_level_cooldown') )]"
  LEVY_OBLIGATIONS_ON_COOLDOWN:1 "You recently changed Levy Obligations in this Province. They can be modified again after [GetCurrentDateWithDiff( GetVarTimeRemaining( PROVINCE.MakeScope, 'levy_level_cooldown') )]"
  QUIT_RENT_ON_COOLDOWN:1 "You recently changed Quit Rent Rights. They can be modified again after [GetCurrentDateWithDiff( GetVarTimeRemaining( CHARACTER.MakeScope, 'quit_rent_cooldown') )]"
  LEGAL_SYSTEM_ON_COOLDOWN:1 "You recently changed Legal System. It can be modified again after [GetCurrentDateWithDiff( GetVarTimeRemaining( CHARACTER.MakeScope, 'legal_system_cooldown') )]"
  ALIENATION_RIGHTS_ON_COOLDOWN:1 "You recently changed Alienation Rights. They can be modified again after [GetCurrentDateWithDiff( GetVarTimeRemaining( CHARACTER.MakeScope, 'alienation_rights_cooldown') )]"
  REALM_LAW_ON_COOLDOWN:1 "You recently changed a Crown Law. They can be changed again after [GetCurrentDateWithDiff( GetVarTimeRemaining( CHARACTER.MakeScope, 'realm_law_cooldown') )]"
  game_concept_invisible_hand_tenure:0 "Land Tenure"
  game_concept_invisible_hand_tenure_desc:0 "$game_concept_invisible_hand_tenure$ is the legal regime in which land is owned by an individual, who is said to "hold" the land. It determines who can use land, for how long, and under what conditions. In a [feudal|e] system, the two main types of tenure are [Concept( 'invisible_hand_tenure_free', 'Free' )|E] and [Concept( 'invisible_hand_tenure_unfree', 'Unfree' )|E]."
  game_concept_invisible_hand_tenure_unfree:0 "Unfree Tenure"
  game_concept_invisible_hand_tenure_unfree_desc:0 "$game_concept_invisible_hand_tenure_unfree$ is a type of [invisible_hand_tenure|E] where tenants are legally tied to their landlord. Such tenants are not free to leave the land they are holding without the consent of the landlord. Furthermore, as part of the contract with their landlord they are expected to use some of their time to farm the lord's demesne or provide other services, possibly in addition to a rent of money or goods."
  invisible_hand_alienation_rights_laws:0 "#e [invisible_hand_alienation|E] Rights#!"
  invisible_hand_alienation_rights_laws_singular:0 "$invisible_hand_alienation_rights_laws$"
  invisible_hand_alienation_rights_0:1 "Subinfeudation"
  invisible_hand_alienation_rights_0_subname:0 "Land Alienation"
  invisible_hand_alienation_rights_0_effects:2 "\nSubinfeudation is the practice by which tenants, holding land under a landlord, are able to carve out new and distinct tenures in their turn by sub-letting or alienating a part of their lands. With such a system, the new tenants owe duties to the person who alienated."
  invisible_hand_alienation_rights_1:1 "Mixed"
  invisible_hand_alienation_rights_1_subname:0 "Subinfeudation and Substitution"
  invisible_hand_alienation_rights_1_effects:2 "\nWith Mixed Alienation Rights, the practices of Subinfeudation and Substitution are both allowed in the Realm."
  invisible_hand_alienation_rights_2:1 "Substitution"
  invisible_hand_alienation_rights_2_subname:0 "Land and Duties Alienation"
  invisible_hand_alienation_rights_2_effects:2 "\nWith substitution, tenants who alienate their land also alienate the duties owed to their lord. As opposed to Subinfeudation, where the new tenant would owe feudal duties to the person who alienated, with Substitution the old tenant is owed nothing from the new tenant, other than the price of the alienation, and the feudal duties are instead tranferred to the new tenants."
  invisible_hand_legal_system_laws:0 "[invisible_hand_legal_system|E]"
  invisible_hand_legal_system_laws_singular:0 "$invisible_hand_legal_system_laws$"
  game_concept_invisible_hand_legal_system:0 "Legal System"
  game_concept_invisible_hand_legal_system_desc:0 "A #e [realm|e]'s#! $game_concept_invisible_hand_legal_system$ defines where the body of law emanates from in that Realm. There are four different types of Legal System: Common Law, Civil Law, Religious Law, and Customary Law."
  invisible_hand_common_law:1 "Common Law"
  invisible_hand_common_law_subname:0 "Law by Code and Precedent"
  invisible_hand_common_law_effects:2 "\nIn a $invisible_hand_common_law$ $game_concept_invisible_hand_legal_system$, the body of law is created by judges and similar quasi-judicial tribunals by virtue of being stated in written opinions. Its defining characteristic is that it arises as precedent. In cases where the parties disagree on what the law is, a common law court looks to past precedential decisions of relevant courts, and synthesizes the principles of those past cases as applicable to the current facts. If, however, the court finds that the current dispute is fundamentally distinct from all previous cases, and legislative statutes are either silent or ambiguous on the question, judges have the authority and duty to resolve the issue."
  invisible_hand_civil_law:0 "Civil Law"
  invisible_hand_civil_law_subname:0 "Law by Code"
  invisible_hand_civil_law_effects:2 "\nIn a $invisible_hand_civil_law$ $game_concept_invisible_hand_legal_system$, the core legal principles are codified into a referable system, which serves as the primary source of law. Codes explain the principles of law, rights and entitlements, and how basic legal mechanisms work. The purpose of codification is to provide all citizens with manners and written collection of the laws which apply to them and which judges must follow."
  invisible_hand_religious_law:0 "Religious Law"
  invisible_hand_religious_law_subname:0 "Law by Religious Canon"
  invisible_hand_religious_law_effects:2 "\nIn a $invisible_hand_religious_law$ $game_concept_invisible_hand_legal_system$, the core legal principles are codified by the religion's ethic and moral codes."
  invisible_hand_customary_law:0 "Customary Law"
  invisible_hand_customary_law_subname:0 "Law by Local Custom"
  invisible_hand_customary_law_effects:2 "\nIn a $invisible_hand_customary_law$ $game_concept_invisible_hand_legal_system$, the body of law is not explicitly codified. Instead, it refers to local customs, that is to say established pattern of behavior and practices that can be objectively verified within a particular sociocultural setting."
  game_concept_invisible_hand_tenure_free:0 "Free Tenure"
  game_concept_invisible_hand_tenure_free_desc:0 "$game_concept_invisible_hand_tenure_free$ is a type of [invisible_hand_tenure|E] where tenants hold land in exchange for some sort of rent or service to the landlord. As opposed to [invisible_hand_tenure_unfree|E], free tenants are not tied to the land they hold and the reciprocal obligations with their landlord are clearly defined in advance."
