  invisible_hand_refugee.02.desc:0 "As a consequence of the recent turmoil in [county.GetName], some of the local population has fled [origin_province.GetName] to look for a safer home for themselves and their families. \n\nAfter reaching [destination_county.GetName], they have decided to settle in [destination_province.GetName]."
