  game_concept_invisible_hand_population:0 "Population"
  game_concept_invisible_hand_population_desc:0 "$game_concept_invisible_hand_population$ represents the number of people living in a [county|e] or [holding|e]. A higher Population means that a Holding is able to provide more [levies|e] and [taxes|e] to its [holder|e]. \n\nPopulation grows dynamically according to various factors, such as its current level, the County's [development|e] and [control|e], and the Holding's [terrain|e] and [Concept( 'holding_type', 'Type' )|E]. \n\nConversely, if a Holding is [Concept( 'raid', 'Raided' )|E] or [occupied|e] in a [siege|e], its Population will decrease."
  game_concept_invisible_hand_climate:0 "Climate"
  game_concept_invisible_hand_climate_desc:0 "Climate is the long-term average of weather. Climates can be classified according to the average and typical ranges of different variables, most commonly temperature and precipitation. Nine different climate types can be found within the game: [invisible_hand_tropical_climate|e], [invisible_hand_arid_climate|e], [invisible_hand_semi_arid_climate|e], [invisible_hand_subtropical_climate|e], [invisible_hand_subtropical_humid_climate|e], [invisible_hand_oceanic_climate|e], [invisible_hand_continental_climate|e], [invisible_hand_boreal_climate|e], and [invisible_hand_alpine_climate|e]."
  game_concept_invisible_hand_tropical_climate:0 "Tropical"
  game_concept_invisible_hand_tropical_climate_desc:0 "Tropical climates are characterized by high monthly average temperatures year-round. Annual precipitation is often abundant, and shows a seasonal rhythm to varying degrees. There are normally only two seasons in tropical climates, a wet season and a dry season."
  game_concept_invisible_hand_arid_climate:0 "Desert"
  game_concept_invisible_hand_arid_climate_desc:0 "A desert or arid climate is a climate in which there is an excess of evaporation over precipitation. The typically bald, rocky, or sandy surfaces in desert climates hold little moisture and evaporate the little rainfall they receive."
  game_concept_invisible_hand_semi_arid_climate:0 "Semi-Arid"
  game_concept_invisible_hand_semi_arid_climate_desc:0 "A semi-arid, semi-desert, or steppe climate is the climate of a region that receives precipitation below potential evapotranspiration, but not as low as a desert climate. Semi-arid climates are usually dominated by either grasses or shrubs."
  game_concept_invisible_hand_subtropical_climate:0 "Mediterranean"
  game_concept_invisible_hand_subtropical_climate_desc:0 "A Mediterranean climate, or dry summer subtropical climate, is a climate characterized by dry summers and mild, wet winters."
  game_concept_invisible_hand_subtropical_humid_climate:0 "Humid Subtropical"
  game_concept_invisible_hand_subtropical_humid_climate_desc:0 "A humid subtropical climate is a climate characterized by hot and humid summers, and cold to mild winters."
  game_concept_invisible_hand_oceanic_climate:0 "Oceanic"
  game_concept_invisible_hand_oceanic_climate_desc:0 "An oceanic climate, also known as a maritime climate, is a climate that generally features cool summers (relative to their latitude) and cool but not cold winters, with a relatively narrow annual temperature range and few extremes of temperature. Such a climate typically lacks a dry season, as precipitation is more evenly dispersed throughout the year."
  game_concept_invisible_hand_continental_climate:0 "Continental"
  game_concept_invisible_hand_continental_climate_desc:0 "Continental climates often have a significant annual variation in temperature (hot summers and cold winters). They tend to occur in the middle latitudes, where prevailing winds blow overland, and temperatures are not moderated by bodies of water such as oceans or seas. In such climates precipitation tends to be moderate in amount, concentrated mostly in the warmer months."
  game_concept_invisible_hand_boreal_climate:0 "Boreal"
  game_concept_invisible_hand_boreal_climate_desc:0 "A boreal climate, also known as subarctic climate, is a climate characterised by long, usually very cold winters, and short, cool to mild summers. It is found on large landmasses, away from the moderating effects of an ocean."
  game_concept_invisible_hand_alpine_climate:0 "Sub-Alpine"
  game_concept_invisible_hand_alpine_climate_desc:0 "Sub-Alpine climate is the climate typical of regions with mountains high enough to be above the tree line. This climate is similar to continental climate, although it tends to be drier and cooler due to the altitude."
